import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the mobile menu trigger (nav-menu) using text selector
    await page.waitForSelector('text=All', { timeout: 5000 });

    // Click the mobile menu trigger (nav-menu)
    await page.click('div.nav-menu');

    // Wait for the mobile menu overlay to appear (using class and visible state)
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Take screenshot after mobile menu opens
    const step2 = path.join(screenshotsDir, 'step_2_mobile_menu_open.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for a category link inside the mobile menu (e.g., "Electronics")
    // Use xpath to ensure we get the link inside the overlay
    const electronicsLinkXPath = "//div[contains(@class,'mobile-menu')]//a[contains(.,'Electronics')]";
    await page.waitForSelector(`xpath=${electronicsLinkXPath}`, { timeout: 5000 });

    // Click the "Electronics" link in the mobile menu
    await page.click(`xpath=${electronicsLinkXPath}`);

    // Take screenshot after clicking a category link
    const step3 = path.join(screenshotsDir, 'step_3_category_clicked.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Wait for the mobile menu close button (inside overlay)
    await page.waitForSelector('#mobileMenuOverlay.show button.close-mobile-menu', { timeout: 5000 });

    // Click the close button to close the mobile menu
    await page.click('#mobileMenuOverlay.show button.close-mobile-menu');

    // Wait for the overlay to disappear
    await page.waitForSelector('#mobileMenuOverlay.show', { state: 'detached', timeout: 5000 });

    // Take screenshot after closing the mobile menu
    const step4 = path.join(screenshotsDir, 'step_4_mobile_menu_closed.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    // Extract some data to verify navigation (e.g., check if main content updated)
    // Try to get the main heading after category click
    let mainHeading = '';
    try {
      await page.waitForSelector('h2', { timeout: 2000 });
      mainHeading = await page.$eval('h2', el => el.textContent.trim());
    } catch {}

    return {
      success: true,
      action: "Tested mobile menu navigation: opened menu, clicked Electronics, closed menu.",
      extractedData: {
        mainHeading
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
